import React from "react";
import "./Statistics.css";

const Statistics = () => {
  return (
    <>
      <div className="statistic">
        <div className="statHeader">
          <h1>Environmental Impact Statistics</h1>
          <p>
            Studies have shown the positive environmental impact of electric
            vehicles:
          </p>
          <ul>
            <li>Electric vehicles produce 0% tailpipe emissions.</li>
            <li>
              EVs can reduce greenhouse gas emissions by more than 50% compared
              to traditional gasoline vehicles.
            </li>
          </ul>
        </div>
        <div className="container">

        </div>
      </div>
    </>
  );
};
export default Statistics;
